export default function Portfolio() {
  return (
    <div>
      <h1>Portfolio</h1>
      <Project />
    </div>
  );
}

function Project() {
  return (
    <div>
      <img
        src="https://cdn.britannica.com/79/232779-050-6B0411D7/German-Shepherd-dog-Alsatian.jpg"
        alt="react-logo"
      />
    </div>
  );
}
